// ETH Page -- Sparkline
// Author: Samuel Adamson
import axios from 'axios';
import { Component } from 'react';
import { ToggleButtonGroup, ToggleButton } from 'react-bootstrap';
import { Line } from 'react-chartjs-2';

class EthSpark extends Component {
    constructor() {
        super();
        this.state = {
            ethSpark: { day: null, week: null, month: null, year: null}
        };
    };




    render() {
        return(
            <div className="EthSpark spark">
                <ToggleButtonGroup type="radio" defaultValue={0}>
                    <ToggleButton value={0}> 1D </ToggleButton>
                    <ToggleButton value={1}> 1W </ToggleButton>
                    <ToggleButton value={2}> 1M </ToggleButton>
                    <ToggleButton value={3}> 1Y </ToggleButton>
                </ToggleButtonGroup>
            </div>
        );
    }
}

export default EthSpark;
